import React from "react";
import { Link } from "react-router-dom";

function Heroheader() {
  return (
    <>
      <section className="container col-2-herro-header">
        <nav>
          <ul className="main_links">
            <li>
              <Link to="/about">About the Company</Link>
            </li>
            <li>
              <Link to="gallery">Product Gallery</Link>
            </li>
            <li>
              <Link to="/rating">Ratings & Reviews</Link>
            </li>
          </ul>
        </nav>
      </section>
    </>
  );
}
export default Heroheader;
